  [],\n\t\"revision_timestamp\": \"2016-07-27T22:40:21.220751\",\n\t\"name\": \"narrative-report-mark-twain-national-wildlife-refuge-annada-district-1972\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mark Twain
  NWR (Clarence Cannon and Delair Units) outlines Refuge accomplishments during the
  1972 calendar year. The report begins by summarizing the weather conditions, habitat
  conditions, water conditions, and food and cover conditions during the year. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, collections and receipts, vegetation control,
  and prescribed burning. Resource management is outlined; topics include haying.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, violations, and safety. Items of interest are attached.\",\n\t\"license_title\":
